outliers.value:
Individual participant data will be excluded if:

a) an entire block of data is compromised by 75% missing responses (e.g., technical error, participant exits during experiment), or one identical response throughout (e.g., selecting 1 for all perceptual trials);

b) that individual’s overall accuracy across all blocks is not significantly greater than 20%

